import React, { Component } from 'react';
import axios from 'axios';
import './home.css'
class Home extends Component {
    state = {
        posts: []
    }
    componentDidMount() {
        axios.get('https://jsonplaceholder.typicode.com/posts').then(res => {
            console.log(res)
            this.setState({
                posts: res.data.slice(0, 9)
            })
        })
    }
}



export default Home
